import React from 'react'
import Header from './Components/Header'
import AddBook from './Components/AddBook'
import BookList from './Components/BookList'

const Home = () => {
  return (
    <div>
      <Header />
      <AddBook />
      <BookList />
    </div>
  );
};

export default Home
